import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';

// components
import Navigation from './components/Navigation.js'
import Home from './components/Home.js'
import AboutMe from './components/AboutMe.js'
import Software from './components/Software.js'
import Hardware from './components/Hardware.js'
import Music from './components/Music.js'
import Photography from './components/Photography.js'
import Blog from './components/Blog.js'
import Contact from './components/Contact.js'

function App() {
  return (
    <Router>
      <div className="App">
        <Navigation/>
        <Route exact path="/Home.js" component={Home}/>
        <Route path="/AboutMe.js" component={AboutMe}/>
      </div>
    </Router>
  );
}

export default App;
